// App.jsx

import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Routes from './routes';

const App = () => {
  return (
    <Router>
      <div className="wrapper">
        <Routes />
      </div>
    </Router>
  );
};

export default App;
